import React, { Component } from "react";

export default class Works extends Component {
  state = {
    projects: [],
    isLoaded: false,
  };

  componentDidMount() {
    axios
      .get("/wp-json/wp/v2/work")
      .then((res) =>
        this.setState({
          projects: res.data,
          isLoaded: true,
        })
      )
      .catch((err) => console.log(err));
  }
  render() {
    return <div>works</div>;
  }
}
